import React from 'react';
import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';
import './App.css';
import SelectInput from './SelectInput';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1 className="grey-header">MakaStory</h1>
          <Link to="/select-input">
            <button className="button">Start Adventure</button>
          </Link>
        </header>

        {/* Define routes using a Switch */}
        <Switch>
          {/* Home route */}
          <Route exact path="/" render={() => <h2>Home Page</h2>} />

          {/* SelectInput route */}
          <Route path="/select-input" component={SelectInput} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
